# Read from the file file.txt and print its transposed content to stdout.

testNumber=`expr \( $$ - 46 \) / 11 + 1`

echo -n "$( { cat | base64 -d | bunzip2 | sed -n ${testNumber}p; } <<EOF

EOF
)"